import { useCallback } from "react";

const BISQ_BASE64 = 'data:image/webp;base64,';
const HODLHODL_BASE64 = 'data:image/webp;base64,'
const ROBOSATS_BASE64 = 'data:image/webp;base64,'

const BISQ = 'Bisq';
const HODLHODL = 'HodlHodl';
const ROBOSATS = 'Robosats';

interface IExchange {
  name: string;
}

export default function Exchange({ name }: IExchange) {

  const extractImg = useCallback((name: string) => {
    switch(name) {
      case BISQ:
        return {
          src: BISQ_BASE64,
          url: 'https://bisq.network/'
        }
      case HODLHODL:
        return {
          src: HODLHODL_BASE64,
          url: 'https://hodlhodl.com/'
        };
      default:
        return {
          src: ROBOSATS_BASE64,
          url: 'https://github.com/Reckless-Satoshi/robosats/#user-content-robosats---buy-and-sell-satoshis-privately'
        }
    }
  }, [])

  const { url, src } = extractImg(name);
  return (
    <a href={url} target="_blank">
      <img className="exchange-icon" src={src}/>
    </a>
  )
}